import React from 'react';
import { Paper, Col, Container, Text, Title, Button } from '@mantine/core';

const LandingPage = () => {
    return (
        <Paper padding="xl" shadow="xs" style={{ margin: '40px' }}>
            <Container size="md">
                <Col style={{ padding: '40px' }}>
                    <Title order={1}>Welcome to Our Website!</Title>
                    <Text>
                        We provide top notch services in a variety of sectors. Please browse through our offerings.
                    </Text>
                    <Button
                        variant="outline"
                        color="blue"
                        size="lg"
                        radius="xl"
                        style={{ marginTop: '20px' }}
                    >
                        Learn more
                    </Button>
                </Col>
            </Container>
        </Paper>
    );
};

export default LandingPage;
